import React from 'react'
import Navbar from '../Navbar/Navbar'
import shopping from '../../img/shopping.jpg'

function Home() {
  return (
    <>
    <Navbar/>
    <img
    src={shopping}
    alt='error'
    className='banner' />
    
    </>
  )
}

export default Home
